INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 1, 1, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 125801, 1, "リリ", 321);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 1, 1, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 126001, 2, "クリア", 322);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 1, 1, 0, "んーと。\nこれ、あげる。\nはい", 40011, 126101, 3, "プレシア", 323);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 2, 1, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 125801, 4, "リリ", 324);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 2, 1, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 126001, 5, "クリア", 325);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 24001, 2, 1, 0, "お兄。\nきてくれて、うれしい", 40011, 126101, 6, "プレシア", 326);
